import Footer from "../Footer";

function Contact() {
  return (
    <>
      {/* <h1 className="specials">Specials</h1> */}
      <div className="contact_container">
        <Map
          google={this.props.google}
          zoom={8}
          style={mapStyles}
          initialCenter={{ lat: 47.444, lng: -122.176 }}
        />
      </div>
      <Footer />
    </>
  );
}
export default GoogleApiWrapper({
  apiKey: 'TOKEN HERE'
})(MapContainer);

const mapStyles = {
  width: '100%',
  height: '100%',
};
